import React from "react";
import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div class="container">
      <div class="row">
        <div class="col-6">column one</div>
        <div class="col-6">
          <span>
            <i class="fa fa-home" aria-hidden="true"></i>
          </span>
        </div>
      </div>
    </div>
  );
}

export default App;
